    soup = BeautifulSoup(page.content, 'html.parser')
    
    pictures = soup.find("a", rel="lightbox")
    picture = pictures.get('href')
    print(picture)
    if(picture != None):
        resp = requests.get(picture)
        picture = resp.content

        bytea_imagem = psycopg2.Binary(picture)
        f.writelines(f"UPDATE pokemon SET img = {bytea_imagem} || id;\n")
        

  